    constructor(settings) {
        this.settings = settings;
        this.proxy = { // for testing with Charles
            host: 'localhost',
            port: 8888
        }
    }

    async auth() {

        const params = new URLSearchParams()
        params.append('grant_type', this.settings.grant_type)
        params.append('scope', this.settings.scopes)
        params.append('client_id', this.settings.auth.client_id)
        params.append('client_secret', this.settings.auth.client_secret)

        const headers = {
            'Content-Type': 'application/x-www-form-urlencoded',
        }

        try {
            const result = await axios.post(this.settings.token_url, params, {
                headers,
                //params,
                proxy: this.proxy
            })

            this.access_token = result.data.access_token;

            return {
                success: true,
                data: result.data
            };
        } catch (err) {
            return {
                success: false,
                error: { reason: 'Something went wrong.' }
            };
        }
    }

